- input: TEXT,F3N,,"For full disclosure, it should be noted that the committee showed
    a positive bank balance at the close of this reporting period and continues to
    maintain such.  The discrepancy between the positive bank balance and the negative
    cash on hand reported here is the result of uncleared checks disbursed by the
    committee.  Action has been taken by way of added contributions that will be shown
    in the forthcoming report to ensure that the bank balance is incapable of being
    overdrawn.  The committee has reviewed and updated its policies and procedures
    to ensure that the book balance remains positive moving forward."
